  false,\n\t\"url\": null,\n\t\"notes\": \"This component data layer (_CMP.txt) file
  gives information about selected components (minerals, rock type, microfossils,
  benthic biota) and seafloor features (bioturbation, structure, ripples) at a given
  site. Values in the attribute fields represent the membership to that attribute's
  fuzzy set. For components such as minerals, rocks, micro-biota and plants, and/or
  epifauna and infauna, corals and other geologic and biologic information, the value
  depends on sentence structure and other components in description. For features
  (denoted by an asterisk) such as ripples, ophiuroids, sponges, shrimp, worm tubes,
  lamination, lumps, grading, and/or bioturbation, the value of the fuzzy set depends
  on the development of the attribute. Only the relative fuzzy presence of components
  and features can be determined; the absence of information does not indicate a lack
  of the attribute, only lack of information about that attribute.\",\n\t\"license_title\":
